translated_text:
Tatar: Әгәр сез дөньны тулысынча Көньяк ярымшарында очып чыгарга теләсәгез, трансокеаник маршрутлар салынмаганга күрә очышлар һәм бару өчен урыннар сайлавы чикле булачак. 
English: If you want to use the Tatar language in your application, you need to add the following code to your application:
public static final String LANGUAGE = "en";

public static final String TATAR = "tat";

public static final String TATAR_EN = "tat_en";

public static final String TATAR_TAT = "tat_tat";

public static final String TATAR_TAT_EN = "tat_tat_en";

public static final String T

